import React, { useEffect, useState } from "react";
import { authAxios } from "../authaxios/auth/authaxios";

const Main = () => {


    const [userData  , setUserData ] = useState([])


    
     


  function GetData() {
    authAxios
      .get("GetData")
      .then((res) => {
        console.log(res.data);
        setUserData(res.data)
      })
      .catch((err) => {
        console.log(err);
      });
  }

  useEffect(() => {
    GetData()
  }, []);
  

  return <div>


    <table>
          <thead> 
            <th>S.no</th>
            <th>Name</th>
            <th>Email</th>
          </thead>
           <tbody>
             {
                userData && userData?.map((v, i )=>{


                      let {email , mob } = v
                  
                       
                })
             }
           </tbody>
    </table>


  </div>;
};

export default Main;
